"'Start Screen' As screen.'tabletLayout_Tutorial_ver3.0'":
    BackgroundImage: |-
        ="data:image/png;base64,"

    TutorialNavigator1 As gallery.TutorialGalleryHorizontal:
        AccessibleLabel: ="Layouts_Tutorial_Gallery_Accessible_Text"
        Height: =55
        Items: |-
            =Table(         
             {Step: 0, Text:"Our Online Test Taking feature offers a wide range of carefully crafted questions designed to challenge and evaluate your abilities, our extensive question database has got you covered.", Image: 'surface1-removebg-preview'},         
             {Step: 1, Text:"As a Contributor, you have the opportunity to create and submit high-quality exam questions that challenge and inspire learners. Your expertise and insights will play a vital role in shaping the educational experience for aspiring students in various subjects.", Image: 'Group_409-removebg-preview'},         
             {Step: 2, Text:"As a Contributor, you have the opportunity to create and submit high-quality exam questions that challenge and inspire learners. Your expertise and insights will play a vital role in shaping the educational experience for aspiring students in various subjects.", Image: '5187551__2__1-removebg-preview'}        
            )
        ShowScrollbar: =false
        TemplatePadding: =8
        TemplateSize: =25
        Width: =CountRows(Self.AllItems) * (Self.TemplateWidth + Self.TemplatePadding) + 5
        X: =908
        Y: =971
        ZIndex: =2

        Circle2 As circle:
            BorderColor: =RGBA(237, 237, 237, 1)
            BorderThickness: =2
            Fill: |-
                =If(Or(ThisItem.Step = 1 && IsBlank(_guideStep), ThisItem.Step = _guideStep), NextBtn.Fill, RGBA(0,0,0,0))
                //Switch(_guideStep,0,NextBtn.Color,1,NextBtn.Color,2,NextBtn.Color)
            FocusedBorderThickness: =4
            Height: =Circle2.Width
            OnSelect: =Set(_guideStep, ThisItem.Step)
            TabIndex: =0
            Width: =Parent.TemplateWidth - 5
            X: =Parent.TemplateWidth/2 - Self.Width/2
            Y: =Parent.TemplateHeight/2 - Self.Height/2
            ZIndex: =1

    TutorialImage1 As image:
        AccessibleLabel: ="Layouts_Tutorial_Image_Accessible_Text"
        Height: =479
        Image: =If(IsBlank(_guideStep), First(TutorialNavigator1.AllItems).Image, LookUp(TutorialNavigator1.AllItems, Step = _guideStep).Image)
        Width: =916
        X: =502
        Y: =201
        ZIndex: =3

    TutorialText1 As label:
        Align: =Align.Center
        Color: =RGBA(75, 75, 75, 1)
        Font: =Font.Arial
        Height: =105
        LineHeight: =1.3
        PaddingLeft: =20
        PaddingRight: =20
        Size: =15
        Text: =If(IsBlank(_guideStep), First(TutorialNavigator1.AllItems).Text, LookUp(TutorialNavigator1.AllItems, Step = _guideStep).Text)
        Width: =716
        X: =602
        Y: =784
        ZIndex: =4

    LabelSkip1 As label:
        Align: =Align.Center
        BorderColor: =Self.Color
        FocusedBorderThickness: =2
        Font: =Font.Arial
        FontWeight: =FontWeight.Semibold
        Height: =55
        OnSelect: |-
            =//Set(_guideStep, Last(TutorialNavigator1.AllItems).Step);
            Navigate('Welcome Page');
        Size: =13
        TabIndex: =0
        Text: ="Lets go"
        Underline: =true
        Visible: =_guideStep = 2
        Width: =100
        X: =1054
        Y: =907
        ZIndex: =7

    NextBtn As button:
        OnSelect: |-
            =Set(_guideStep, Min(_guideStep+1, Last(TutorialNavigator1.AllItems).Step));
            //If(_guideStep <2  ,Navigate('Welcome Page'))
        Text: ="Next"
        X: =880
        Y: =915
        ZIndex: =8

    PreviousBtn As button:
        OnSelect: =Set(_guideStep, Max(_guideStep-1, First(TutorialNavigator1.AllItems).Step))
        Text: ="Previous"
        Visible: |-
            =//_guideStep > 0
            false
        X: =489
        Y: =955
        ZIndex: =9

    TutorialText1_1 As label:
        Align: =Align.Center
        Color: =RGBA(51, 51, 51, 1)
        Font: =Font.Arial
        FontWeight: =FontWeight.Bold
        Height: =65
        LineHeight: =1.3
        PaddingLeft: =20
        PaddingRight: =20
        Size: =25
        Text: =Switch(_guideStep,0,"Text Taker",1,"Reviewer",2,"Contributor")
        Width: =621
        X: =650
        Y: =719
        ZIndex: =10

    Image2 As image:
        Height: =73
        Image: ='Group 1'
        Width: =68
        X: =926
        Y: =50
        ZIndex: =11

